import { useContext } from "react"
import { contaxtCreation } from "../../App"

function ReduceClass() {
    const contaxt = useContext(contaxtCreation)
    console.log(contaxt);
    return (
        <div>
            <ul>
                {contaxt.state.map((item, i) => {
                    return <li key={i}>{item}</li>
                })}
            </ul>
        </div>
    )
}
export default ReduceClass
